   /**
   * filter prospect list page according to the text in the search bar
   * @param {any} event from search bar's input
   */
  getItems(ev: any) {

    // set val to the value of the searchbar
    const val = ev.target.value;

    // if the value is an empty string don't filter the items
    if (val && val.trim() != '') {
      this.lamentables = this.lamentables.filter((lamentable) => {
        return (lamentable.nombre.toLowerCase().indexOf(val.toLowerCase()) > -1);
      })
    }
  }

  
